import React, {useState} from "react";

function TodoItem(props) {
    return (
        <div
          onClick={() => {
            props.onChecked(props.id);
          }}
        >
            <li>{props.todoList} <i class="fas fa-trash-alt"></i> </li>
        </div>
    );
}


export default TodoItem;
